 Here's the TypeScript function to produce full name from first name and last name:
```javascript
function getFullName(firstName: string, lastName: string): string {
  return firstName + " " + lastName;
}
```
You can use this function as follows:
```javascript
const firstName = "John";
const lastName = "Doe";
const fullName = getFullName(firstName, lastName); // return "John Doe"
```
Note that this function assumes that the first name and last name are already valid English names with spaces
